import axios from "axios";

const UserService = {
  register: function() {},

  login: function(user) {
    return new Promise(function(resolve, reject) {
      axios
        .post(
          "http://localhost:5000/api/login",
          {
            username: user.username,
            password: user.password
          },
          { withCredentials: true }
        )
        .then(res => {
          resolve(res);
        });
    });
  },

  logout: function() {}
};

export default UserService;
